---
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: aws-secret
  namespace: kubeflow
spec:
  encryptedData:
    AWS_ACCESS_KEY_ID: 
    AWS_DEFAULT_REGION: 
    AWS_REGION: 
    AWS_S3_ENDPOINT: 
    AWS_S3_FORCE_PATH_STYLE: 
    AWS_S3_USE_PATH_STYLE: 
    AWS_S3_USE_SSL: 
    AWS_S3_VERIFY_SSL: 
    AWS_SECRET_ACCESS_KEY: 
    AWS_SSL: 
    MINIO_SSL: 
    S3_ENDPOINT: 
    S3_USE_HTTPS: 
    S3_VERIFY_SSL: 
  template:
    metadata:
      annotations:
        reflector.v1.k8s.emberstack.com/reflection-allowed: "true"
        reflector.v1.k8s.emberstack.com/reflection-allowed-namespaces: frederik-coquelet,kubeflow,admin,nessie
        reflector.v1.k8s.emberstack.com/reflection-auto-enabled: "true"
        reflector.v1.k8s.emberstack.com/reflection-auto-namespaces: frederik-coquelet,kubeflow,admin,nessie
      name: aws-secret
      namespace: kubeflow
    type: Opaque
